let punteggiomax = 0
let prima = true
document.addEventListener("DOMContentLoaded", function () {
    let gioco
    let gioc = document.createElement("div")
    gioc.id = "gioco"
    document.getElementsByTagName("body")[0].appendChild(gioc)

    gioco = kaplay({
        width: 1400,
        height: 400,
        letterbox: true,

    });
    gioco.setBackground(new Color(128, 128, 128))
    document.getElementsByTagName("body")[0].style.background="gray"
    document.getElementById("gioco").appendChild(document.getElementsByTagName("canvas")[0])
    loadSprite("sfondo", "data:image/png;base64,");

    loadSprite("terreno", "data:image/png;base64,");

    loadSprite("cactus", "data:image/png;base64,");
    loadSprite("volatile", "data:image/png;base64,");
    loadSprite("cactussi", "data:image/png;base64,");
    loadSprite("trexcorsa", "data:image/png;base64,");
    loadSprite("trexcorsa2", "data:image/png;base64,");
    loadSprite("trex_down", "data:image/png;base64,");
    gioco.loadSprite("trex_down2", "data:image/png;base64,");
    scene("gioco", () => {

        let punteggio = 0

        sconfitta = false
        let tempo = 0
        punteggio = 0
        let tempot = gioco.add([
            gioco.text("Tempo: " + tempo, { size: 32 }),
            gioco.pos(10, 10),
            gioco.color(0, 0, 0),
            gioco.z(3),
        ]);
        let punteggiot = gioco.add([
            gioco.text("Punteggio: " + punteggio, { size: 32 }),
            gioco.pos(550, 10),
            gioco.color(0, 0, 0),
            gioco.z(3),
        ])
        let punteggiomaxt = gioco.add([
            gioco.text("Punteggio massimo: " + punteggiomax, { size: 32 }),
            gioco.pos(1000, 10),
            gioco.color(0, 0, 0),
            gioco.z(3),
        ])




        gioco.setGravity(1100);
        const giocatore = gioco.add([
            gioco.sprite("trexcorsa"),
            scale(1),
            gioco.pos(0, 350),
            gioco.area(),
            gioco.body(),
            gioco.z(2),
            "personaggio"
        ])
        gioco.add([
            gioco.sprite("sfondo"),
            gioco.pos(0, -350),
            gioco.scale(1.6),
            gioco.z(1),
        ]);
        gioco.add([
            gioco.rect(gioco.width(), 300),
            gioco.pos(0, 350),
            gioco.area(),
            gioco.outline(3),
            gioco.body({ isStatic: true })

        ])



        giocatore.onKeyDown((key) => {
            if (key === "down" || key === "s") {
                if (giocatore.isGrounded()) {
                    giocatore.use(gioco.sprite("trex_down"));
                    down = true

                }
                else {
                    gioco.setGravity(2000)
                }
            }
        })
        giocatore.onKeyRelease((key) => {
            if (key === "down" || key === "s") {
                giocatore.use(gioco.sprite("trexcorsa"));
                giocatore.use(gioco.area());
                down = false
            }
        });
        giocatore.onKeyPress((key) => {
            if (key === "space" || key === "w" || key === "up") {
                if (giocatore.isGrounded()) {
                    gioco.setGravity(1100)
                    giocatore.jump()

                }
            }



        })
        let animazione = false
        let down = false

        gioco.loop(1, () => {

            tempot.text = "tempo: " + tempo
            tempo += 1


        })
        gioco.loop(0.1, () => {

            punteggio += 1
            punteggiot.text = "punteggio: " + punteggio
            

        })
        gioco.loop(0.20, () => {

            if (!animazione && down) {
                giocatore.use(gioco.sprite("trex_down2"));
                animazione = true
            }
            else if (animazione && down) {
                giocatore.use(gioco.sprite("trex_down"));
                animazione = false
            }


        })

        gioco.loop(0.3, () => {

            if (!animazione && !down) {
                giocatore.use(gioco.sprite("trexcorsa2"));
                animazione = true
            }
            else if (animazione && !down) {
                giocatore.use(gioco.sprite("trexcorsa"));
                animazione = false
            }



        })

        gioco.loop(2, () => {

            let scelta = Math.floor(Math.random() * 3)
            let oggetto
            if (scelta == 0) {
                oggetto = gioco.add([
                    gioco.sprite("cactus"),
                    gioco.pos(1340, 250),
                    gioco.area(),
                    gioco.body(),
                    gioco.outline(3),
                    gioco.move(0, -300),
                    gioco.z(2),
                    "nemico"
                ])
            }
            else if (scelta == 1) {
                oggetto = gioco.add([
                    gioco.sprite("cactussi"),
                    gioco.pos(1340, 250),
                    gioco.area(),
                    gioco.body(),
                    gioco.outline(3),
                    gioco.move(0, -300),
                    gioco.z(2),
                    "nemico"
                ])
            }
            else {
                oggetto = gioco.add([
                    gioco.sprite("volatile"),
                    gioco.pos(1340, 200),
                    gioco.area(),
                    gioco.body(),
                    gioco.outline(3),
                    gioco.move(0, -300),
                    gioco.z(2),
                    gioco.body({ isStatic: true }),
                    "uccello"
                ])
            }
                
                
                onCollide("nemico", "personaggio", () => {
                    go("sconfitta")


                })
                onCollide("uccello", "personaggio", () => {
                    if (!down){
                        go("sconfitta")
                    }
                    
                })
                scene("sconfitta", () => {
                    gioco.add([
                        gioco.text("Hai perso", { size: 50 }),
                        gioco.pos(550, 10),
                        gioco.color(0, 0, 0),
                        gioco.z(3),
                    ]);
                    const bottone = add([
                        rect(260, 100, { radius: 8 }),
                        area(),
                        scale(1),
                        anchor("center"),
                        outline(4),
                        color(255, 255, 255),

                        pos(670, 200),
                        z(3),
                    ]);
                    bottone.add([
                        text("ricominciare?"),
                        anchor("center"),
                        color(0, 0, 0),
                    ]);
                 
                    bottone.onMousePress(()=>{
                        go("gioco")
                        gioco.setBackground(new Color(128, 128, 128))
                        document.getElementsByTagName("body")[0].style.background="gray"
                    })
                    gioco.setBackground(new Color(255, 0, 0))
                    document.getElementsByTagName("body")[0].style.background="red"
                    if (punteggio > punteggiomax) {
                        punteggiomax = punteggio
                        punteggiomaxt.text = "punteggio massimo: " + punteggiomax
                    }
                    
                })
            })

        


    })


    go("gioco")










})